import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';  // For graph plotting
import { MapContainer, TileLayer, Polyline } from 'react-leaflet'; // For map display
import 'leaflet/dist/leaflet.css';  // Leaflet map styles
import api from '../../utils/api';
import { getCurrentLocation, simulateGpsData, smartGpsTracking, generateSimulatedRoute } from '../../utils/geolocation';
import './Dashboard.scss';  // SCSS styling

const Dashboard = () => {
  const [gpsData, setGpsData] = useState([]);  // Stores the GPS data for the day
  const [chartData, setChartData] = useState(null);  // Data for graph plotting
  const [route, setRoute] = useState([]);  // Route data for map plotting
  const [isTracking, setIsTracking] = useState(false);  // Tracks if GPS tracking is active
  const [error, setError] = useState(null);  // Error state for handling issues

  // **Start or stop GPS tracking**
  const toggleTracking = () => {
    if (isTracking) {
      setIsTracking(false);
    } else {
      setIsTracking(true);
      startTracking();
    }
  };

  // Simulate GPS tracking for testing
  const startTracking = () => {
    const simulatedBatches = generateSimulatedRoute(1, 5);  // Generate 5 GPS batches for driver_id 1
    simulatedBatches.forEach((batch, index) => {
      setTimeout(() => processBatch(batch), index * 5000);  // Process each batch after 5 seconds
    });
  };

  // Process each batch of GPS data (call to /record-telematics)
  const processBatch = async (batch) => {
    const isMoving = smartGpsTracking(batch.gps_data, gpsData);  // Check if car is moving
    if (isMoving) {
      try {
        const driver_id = localStorage.getItem('driver_id');  // Get driver ID from localStorage
        const response = await api.post('/record-telematics', {
          driver_id,
          gps_data: batch.gps_data  // Send GPS data for processing
        });

        console.log('Telematics Response:', response.data); // Log the full response for debugging

        // Extract features from the response (features is an object, not an array)
        const features = response.data.features;

        // Update GPS data for route plotting
        setGpsData((prevData) => [...prevData, ...batch.gps_data]);
        setRoute((prevRoute) => [
          ...prevRoute,
          ...batch.gps_data.map((point) => [point.Latitude, point.Longitude])
        ]);

        // **Update the chart with telematics features (e.g., speed, acceleration)**
        updateChart(features);
        
      } catch (error) {
        console.error('Error recording telematics data:', error);
        setError('Error processing GPS data. Please try again.');
      }
    }
  };

  // Update chart data for speed and acceleration
  const updateChart = (features) => {
    const chartLabels = ['Speed', 'Acceleration', 'Jerk', 'Braking Intensity'];
    setChartData({
      labels: chartLabels,
      datasets: [
        {
          label: 'Driving Features',
          data: [
            features['Speed(m/s)'],           // Speed
            features['Acceleration(m/s^2)'],  // Acceleration
            features['Jerk(m/s^3)'],          // Jerk
            features['Braking_Intensity']      // Braking Intensity
          ],
          borderColor: 'rgba(75, 192, 192, 1)',
          fill: false
        }
      ]
    });
  };

  // Render the chart component only if data is available
  const renderChart = () => {
    if (!chartData || !chartData.labels || chartData.labels.length === 0) {
      return <p>No data available yet. Start tracking to see the graph.</p>;
    }

    return <Line data={chartData} />;
  };

  return (
    <div className="dashboard-container">
      <h2>Driver Dashboard</h2>

      <div className="tracking-controls">
        <button onClick={toggleTracking}>
          {isTracking ? 'Stop Tracking' : 'Start Tracking'}
        </button>
      </div>

      {/* Map Section */}
      <div className="map-section">
        <h3>Route Map</h3>
        <MapContainer center={[26.6337, 92.7926]} zoom={14} scrollWheelZoom={false} className="map-container">
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; OpenStreetMap contributors"
          />
          <Polyline positions={route} color="blue" />
        </MapContainer>
      </div>

      {/* Chart Section */}
      <div className="chart-section">
        <h3>Driving Feature Fluctuations</h3>
        {renderChart()}  {/* Render chart */}
      </div>

      {/* Error Message */}
      {error && <div className="error">{error}</div>}
    </div>
  );
};

export default Dashboard;
